import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import { motion } from 'framer-motion';

const HowWeDoIt = () => {
  const [activeSection, setActiveSection] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const observerOptions = {
      threshold: 0.1, // Reduced threshold to detect earlier
      rootMargin: "-20% 0px -80% 0px" // Adjusted to trigger near top of viewport
    };

    const sectionObserver = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting && entry.target.id === 'science-section') {
          setActiveSection(1);
        } else if (!entry.isIntersecting && entry.target.id === 'science-section') {
          setActiveSection(0);
        }
      });
    }, observerOptions);

    // Only observe the science section
    const scienceSection = document.getElementById('science-section');
    if (scienceSection) sectionObserver.observe(scienceSection);

    return () => {
      if (scienceSection) sectionObserver.unobserve(scienceSection);
    };
  }, []);

  const handleBackToHome = (e) => {
    e.preventDefault();
    // Add a custom flag to indicate direction for the home page animation
    navigate('/', { state: { slideDirection: 'left' } });
  };

  const handleSectionChange = (index) => {
    setActiveSection(index);
    const targetSection = index === 0 ? 
      document.getElementById('overview-section') : 
      document.getElementById('science-section');
    targetSection?.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <motion.div
      initial={{ x: '100%' }}
      animate={{ x: 0 }}
      exit={{ x: '-100%' }} // Exit to the left when going back
      transition={{ type: 'tween', duration: 0.5 }}
      className="h-screen overflow-y-auto overflow-x-hidden"
    >
      <div className="fixed top-0 left-0 right-0 z-50">
        <Navbar />
      </div>

      {/* First Section - Dark Blue Background */}
      <section className="relative min-h-screen bg-[#00264D] flex flex-col items-center justify-center">
        {/* Back to Home Link */}
        <h3 
          onClick={handleBackToHome}
          className="fixed top-32 left-20 text-white text-lg cursor-pointer hover:text-green-300 transition-colors duration-300 flex items-center gap-2 group z-40"
        >
          <span className="transform group-hover:-translate-x-2 transition-transform duration-300">←</span>
          Back to Home
        </h3>

        {/* Scroll Indicator */}
        <div className="absolute left-1/2 bottom-1 -translate-x-1/2 flex flex-col items-center gap-2">
          <div className="w-[1px] h-24 bg-white/20 relative overflow-hidden">
            <motion.div 
              className="w-full h-full bg-white"
              animate={{
                y: ['-100%', '100%'],
              }}
              transition={{
                repeat: Infinity,
                duration: 1.5,
                ease: 'linear',
              }}
            />
          </div>
        </div>
      </section>

      {/* White Background Sections */}
      <div className="relative bg-white">
        {/* Fixed Header - Only shows after blue section */}
        <div className="sticky top-0 z-40 bg-white py-8">
          <div className="text-center space-y-4">
            <motion.h1 
              key={activeSection}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              exit={{ opacity: 0, y: -20 }}
              transition={{ duration: 0.3 }}
              className="text-4xl font-serif text-black"
            >
              {activeSection === 0 ? 'Overview' : 'The Science Behind Afiniti'}
            </motion.h1>
            <div className="flex justify-center gap-2">
              {[...Array(2)].map((_, index) => (
                <motion.div
                  key={index}
                  className={`w-2 h-2 rounded-full cursor-pointer`}
                  animate={{
                    backgroundColor: index === activeSection ? '#ec4899' : '#d1d5db'
                  }}
                  transition={{ duration: 0.3 }}
                  onClick={() => handleSectionChange(index)}
                />
              ))}
            </div>
          </div>
        </div>

        {/* Content Sections */}
        <section id="overview-section" className="min-h-screen relative">
          <div className="flex-1 flex flex-col items-center justify-center px-6 pt-32 pb-20">
            {/* Remove the original title section and start with subheading */}
            <h2 className="text-gray-600 text-xl font-light leading-relaxed max-w-2xl text-center mb-16">
              Afiniti Enterprise Behavioral Pairing™ discovers and predicts patterns of interpersonal behavior to optimally pair customers with agents.
            </h2>

            {/* Main paragraph */}
            <p className="text-gray-700 max-w-2xl text-center leading-relaxed mb-16">
              With over 150 patents, Afiniti's technology examines data and commercially available information tied to customer identity to determine patterns of successful behavioral interactions and applies these patterns in real time to drive improvements in health, enterprise profitability, and customer satisfaction.
            </p>

            {/* First Video Container */}
            <div id="first-video" className="w-full max-w-xl h-[400px] mx-auto aspect-video bg-gray-100 rounded-lg overflow-hidden mb-40">
              <video 
                className="w-full h-full object-cover"
                controls
                src="https://res.cloudinary.com/ddzllbqlv/video/upload/v1748342620/zjtzamruh1ztnsjntam7.mp4"
              >
                Your browser does not support the video tag.
              </video>
            </div>
          </div>
        </section>

        {/* Science Section */}
        <section 
          id="science-section" 
          className="min-h-screen relative"
        >
          {/* Reference point for scroll detection */}
          <div className="absolute top-0 h-1 w-full" />

          <div className="flex-1 flex flex-col items-center justify-center px-6 pt-32 pb-20 mt-20">
            {/* Added matching heading for Science Behind Afiniti */}
            <h1 className="text-4xl font-serif text-black mb-16">
              The Science Behind Afiniti
            </h1>
            
            <h2 className="text-gray-600 text-xl font-light leading-relaxed max-w-2xl text-center mb-56">
              In this process we combine interaction-level outcomes data from our clients with hundreds of internal and external databases through highly complex data joins in order to build a rich contextual data source for each interaction. Using this data, Afiniti deploys specialized machine learning techniques to identify behavioral patterns in customer-representative interactions that lead to success.
            </h2>

            {/* Second Video Container */}
            <div className="w-full max-w-xl h-[400px] mx-auto aspect-video bg-gray-100 rounded-lg overflow-hidden">
              <video 
                className="w-full h-full object-cover"
                controls
                src="path-to-your-second-video.mp4"
              >
                Your browser does not support the video tag.
              </video>
            </div>
          </div>
        </section>
      </div>
    </motion.div>
  );
};

export default HowWeDoIt;
